import { createUserWithEmailAndPassword } from "firebase/auth";
import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import { auth } from '../../../firebase';
import {
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardBody,
  MDBInput,
  MDBCheckbox,
  MDBIcon
}
from 'mdb-react-ui-kit';
// import { Link } from "react-router-dom";
import './Register.css';

const Register = () => {
  const navigate = useNavigate();
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const signUp = async (e) => {
    e.preventDefault();

    try {
      const userCredential = await createUserWithEmailAndPassword(auth, email, password);

      let getRandomString = (length) => {
        var randomChars = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
        var result = '';
        for ( var i = 0; i < length; i++ ) {
            result += randomChars.charAt(Math.floor(Math.random() * randomChars.length));
        }
        return result;
      }
      let val = getRandomString(20);

      window.localStorage.setItem('user', JSON.stringify(val));

      navigate('/dashboard'); // Redirect to dashboard after successful login
      swal("SUCCESS!", "Succesfully Signed Up!", "success");
    } catch (error) {
      const errorMessage = error.message;

      if (error.code && error.code.indexOf("auth/") === 0) {
        const errorCode = error.code.split("auth/")[1];
        swal("ERROR!", `${errorCode}`, "error");
      } else {
        swal("ERROR!", `${errorMessage}`, "error");
      }
    }
  }

  return (
    <div className="container-fluid">
        <h2 className="display-1 my-5 text-center">Register</h2>
        <div className="row">
            <div className="col-md-5 mx-auto md-5">
                <RegisterForm />
                <p className="text-end my-2">
                    Already a member? <Link to={`/login`}> Login</Link>
                </p>
            </div>
        </div>
    </div>
  );
}

export default Register;
